CREATE DEFINER=root@localhost PROCEDURE cursosUsuario(IN id_usuario INT)
BEGIN 
select c.id,c.denominacion,c.criterioAprobacion,c.id_carrera,car.denominacion carrera,s.sede,s.id id_sede, 
CASE 
    WHEN c.id in (select id_curso from curso_usuario cu where cu.id_usuario = id_usuario  and cu.id_sede = sc.id_sede) THEN 1 
    ELSE 0 end as inscripto 
 from cursos c  
inner join sede_carrera sc on c.id_carrera = sc.id_carrera 
inner join sedes s on sc.id_sede = s.id 
inner join carreras car on c.id_carrera = car.id 
where sc.id_sede in (select id_sede from sede_usuario su where su.id_usuario = id_usuario) 
group by c.denominacion,criterioAprobacion,id_carrera,s.id 
order by s.id; 
END ;;
